const MovieList = ({users,usersByMovie})=> {

   return(
      <div>
    <ul>
            {Object.keys(usersByMovie).map((movie, i) => {
              return (<li key={movie}> {movie} </li>);
            })}
          </ul>
   </div>
  )

}

export default MovieList
